import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import Tournaments from './pages/Tournaments';
import Account from './pages/Account';
import AdminDashboard from './pages/AdminDashboard';
import Leaderboard from './pages/Leaderboard';
import QueuePage from './pages/QueuePage'; // Ensure proper import
import MatchPage from './pages/MatchPage'; // MatchPage import for match details page
import './App.css';

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [isAdmin, setIsAdmin] = useState(false);

  useEffect(() => {
    const userData = JSON.parse(sessionStorage.getItem('userData') || '{}');
    setIsAuthenticated(!!userData.accessToken);
    setIsAdmin(userData.isAdmin === true || userData.isAdmin === 'true');
  }, []);

  const handleLogin = () => {
    const clientId = process.env.REACT_APP_DISCORD_CLIENT_ID;
    const redirectUri = encodeURIComponent(process.env.REACT_APP_DISCORD_REDIRECT_URL);

    if (!clientId || !redirectUri) {
      console.error('Environment variables for Discord login are not properly set!');
      return;
    }

    const discordAuthUrl = `https://discord.com/api/oauth2/authorize?client_id=${clientId}&redirect_uri=${redirectUri}&response_type=code&scope=identify`;
    window.location.href = discordAuthUrl;
  };

  const handleLogout = () => {
    sessionStorage.clear();
    setIsAuthenticated(false);
    setIsAdmin(false);
  };

  const ProtectedRoute = ({ children }) => {
    return isAuthenticated ? (
      children
    ) : (
      <div className="login-modal">
        <p>You must be logged in to access this page</p>
        <button onClick={handleLogin}>Login with Discord</button>
      </div>
    );
  };

  return (
    <Router>
      <div style={{ display: 'flex', minHeight: '100vh', backgroundColor: '#121212' }}>
        <Sidebar onLogin={handleLogin} onLogout={handleLogout} isAuthenticated={isAuthenticated} />
        <div className="main-content">
          <Routes>
            <Route path="/dashboard" element={<Dashboard />} />
            <Route
              path="/tournaments"
              element={
                <ProtectedRoute>
                  <Tournaments />
                </ProtectedRoute>
              }
            />
            <Route
              path="/queue/:tournamentId"
              element={
                <ProtectedRoute>
                  <QueuePage />
                </ProtectedRoute>
              }
            />
            <Route
              path="/match/:matchId"
              element={
                <ProtectedRoute>
                  <MatchPage />
                </ProtectedRoute>
              }
            />
            <Route
              path="/account"
              element={
                <ProtectedRoute>
                  <Account onLogout={handleLogout} />
                </ProtectedRoute>
              }
            />
            {isAdmin && (
              <Route
                path="/admin-dashboard"
                element={
                  <ProtectedRoute>
                    <AdminDashboard />
                  </ProtectedRoute>
                }
              />
            )}
            <Route path="/tournament/:id/leaderboard" element={<Leaderboard />} />
            <Route path="*" element={<Navigate to="/dashboard" />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
